import React from "react";

export const EditPage = (props) => {
    return(
        <div className="addPage">
            <div className="head">Edit product</div>
            <div className="textBlock">
                <p>avatar url : <input
                    type="text"
                    name="url"
                    value={props.content.url}
                    onChange={props.saveUrl}
                /></p>
                <p>product name : <input
                    type="text"
                    name="name"
                    value={props.content.name}
                    onChange={props.saveName}
                />
                </p>
                <p>desc : <input
                    type="text"
                    name="introduction"
                    value={props.content.inroduction}
                    onChange={props.saveIntroduction}
                /></p>
            </div>
            <div className="bottom">
                <button onClick={() => props.setShowAddPage(false)}>Cancel</button>
                <button
                    onClick={() => {
                        props.setShowAddPage(false);
                        props.handleClick();
                    }}>Ok
                </button>
            </div>
        </div>

    )
}
